import React from "react";

const GastoListView = ({ gastos }) => {
  return (
    <div className="max-w-2xl mx-auto mt-10">
      <h2 className="text-2xl font-bold mb-4 text-center">Lista de Gastos</h2>
      <ul className="space-y-4">
        {gastos.map((gasto, index) => (
          <li key={index} className="p-4 bg-gray-100 rounded-xl shadow space-y-2">
            <div className="flex flex-col text-left">
              <span className="font-semibold">Concepto:</span>
              <span>{gasto.concepto}</span>
            </div>
            <div className="flex flex-col text-left">
              <span className="font-semibold">Monto:</span>
              <span>${gasto.monto}</span>
            </div>
            <div className="flex flex-col text-left">
              <span className="font-semibold">Fecha:</span>
              <span>{gasto.fechaRegistro}</span>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default GastoListView;
